import React from 'react';
import NavigationBar from './components/NavBar/NavigationBar';
import './App.css';

const App = () => {
  return (
    <>
      <div className="App">
        <NavigationBar />
        <h1> Kelly's Portfolio </h1>
      </div>
    </>
  );
}

export default App;
